BEGIN
DECLARE @CODMUN int

DECLARE MY_CURSOR CURSOR 
  LOCAL STATIC READ_ONLY FORWARD_ONLY
FOR 

SELECT CODMUN FROM [TAB MUNICIPIO]

OPEN MY_CURSOR
FETCH NEXT FROM MY_CURSOR INTO @CODMUN
WHILE @@FETCH_STATUS = 0
BEGIN 
  
UPDATE [TAB MUNICIPIO] SET CEP = (SELECT CEP FROM CEPMunicipio WHERE codigo_cidade_ibge = @CODMUN) WHERE CODMUN = @CODMUN

    PRINT 'CODMUN: ' 
	print @CODMUN
    FETCH NEXT FROM MY_CURSOR INTO @CODMUN
END
CLOSE MY_CURSOR
DEALLOCATE MY_CURSOR
END


BEGIN
DROP TABLE CEPMunicipio;
END

